// Navigation.js
import React from "react";
import { Link } from "react-router-dom";
import "./styles/navigation.css";

const Navigation = () => {
  return (
    <div className="navigation">
      <Link to="/analysis">Analysis</Link>
      <Link to="/">Home</Link>
      <input type="text" placeholder="Search..." />
    </div>
  );
};

export default Navigation;
